INSERT INTO `sanpham` VALUES (1, 'Bộ dầu gội Biotin ngăn gầu', , 235000, 50, 'VOUDIOTY', 'Nơi khô ráo', 'Ngăn gầu', 'Hàn Quốc', 500, 'Bộ Gội Xả Ngăn Ngừa Gàu Biotin & Collagen Pasiori Voudioty Professional – Xanh Dương với mùi hương thơm quyến rũ ngây ngất, cho khách cảm giác sảng khoái, thư giản. Với dưỡng chất Biotin & Collagen Protein từ dưỡng chất thiên nhiên bổ sung cho tóc khô xơ hư tổn, giúp tóc suôn mềm mượt và bóng đẹp. Dưỡng cho tóc suôn mềm dễ chải. Ngăn ngừa tóc gãy rụng do sử dụng hóa chất uốn duỗi nhuộm và tác hại của nhiệt độ cao của máy sấy máy kẹp.', '2024-05-06 23:31:26', 1);
INSERT INTO `sanpham` VALUES (2, 'Bộ dầu gội phục hồi đa tầng Nấm Truffle Weilaiya', , 870000, 50, 'WEILAIYA', 'Nơi khô ráo', 'Phục hồi tóc hư tổn', 'Trung Quốc', 500, 'Dầu gội phục hồi dành cho tóc hư tổn, tóc khô xơ, tóc nhuộm, tóc tẩy Nuôi dưỡng da đầu, chống lão hóa da đầu Chứa 2 dưỡng chất đắt đỏ Nấm Truffle trắng (Đức) & Trứng Cá Tầm (Pháp) Hương thơm sang trọng rất giống với nước hoa YSL Black Opium Tóc suôn mượt, vào nếp chuẩn salon', '2024-05-06 23:32:40', 1);
INSERT INTO `sanpham` VALUES (3, 'Chai Dưỡng Thể Vaseline Hồng – 725ml', , 155000, 50, 'VASELINE', 'Điều kiện thường', 'Chống lão hoá, Giữ ẩm, Chống nắng, Làm trắng', 'Hàn Quốc', 725, 'Ưu điểm nổi bật:\r\n\r\n1. Dưỡng ẩm sâu: Vaseline là một trong những thương hiệu nổi tiếng trong việc dưỡng ẩm da, và sản phẩm Vaseline Hồng 725ml không phải là một ngoại lệ. Chất lượng vượt trội giúp giữ cho làn da luôn mềm mịn, không bị khô và bong tróc.\r\n\r\n2. Làm sáng da tự nhiên: Sản phẩm này chứa các thành phần dưỡng da giúp tái tạo làn da, làm sáng vùng da tối màu và tạo nên làn da hồng hào tự nhiên.\r\n3. Không gây kích ứng: Vaseline Hồng 725ml là sản phẩm an toàn cho mọi loại da, ngay cả da nhạy cảm nhất. Không chứa các chất gây kích ứng, sản phẩm này phù hợp cho cả trẻ em và người lớn.\r\n\r\n4. Dung tích lớn: Với dung tích lên đến 725ml, bạn có đủ lâu để sử dụng sản phẩm này và thấy sự thay đổi rõ rệt trên làn da của bạn.\r\n\r\n5. Thiết kế tiện lợi: Chai có nắp vặn tiện lợi giúp bạn dễ dàng kiểm soát lượng sản phẩm sử dụng mà không gây lãng phí.', '2024-05-06 23:34:12', 2);
INSERT INTO `sanpham` VALUES (4, 'Kem Body Whisis', , 160000, 50, 'WHISIS', 'Điều kiện thường', 'Chống Nắng, Làm Trắng', 'Hàn Quốc', 300, 'Có một làn da ẩm mượt, trắng sáng là mong muốn của mọi cô gái. Trên thị trường, có không ít các sản phẩm có khả năng cấp ẩm, dưỡng trắng da. Nếu bạn là một tín đồ của mỹ phẩm Hàn Quốc và đang tìm kiếm một sản phẩm dưỡng da toàn thân thì Lotion Collagen Dưỡng Trắng – Chống nắng Body Cao Cấp Whisis chính là sự lựa chọn hoàn hảo. Lotion Collagen Dưỡng Trắng – Chống nắng Body Cao Cấp Whisis nổi bật với thành phần chính chứa Niacinamide, một loại Vitamin B3 giúp kích thích sự phát triển và hoạt động của tế bào da, giúp ức chế sự hình thành sắc tố melanin, làm sáng da hiệu quả. Thêm vào đó, collagen thủy phân giúp tăng cường khả năng đàn hồi của da, khóa ẩm, chống lão hóa da hiệu quả. Titanium Dioxide cùng chỉ số chống nắng cao, lên đến SPF50+/ PA++++ giúp bảo vệ da toàn diện trước tia UVA và UVB gây hại từ ánh nắng mặt trời. Whisis Premium Collagen Whitening Body Lotion có kết cấu dạng kem đặc, ẩm mướt, mềm mịn, dễ tán, thẩm thấu nhanh vào da, không gây bết dính, không làm bít tắc lỗ chân lông, có hương trái cây ngọt nhẹ. Sản phẩm có khả năng nâng tone nhẹ nhàng, cho da bạn trắng sáng tự nhiên, tức thì. Sử dụng thường xuyên, sẽ cho hiệu quả trắng sáng rõ rệt. Kem dưỡng Whisis chứa các thành phần tự nhiên, lành tính, an toàn cho da, không gây kích ứng, phù hợp với mọi loại da, kể cả da nhạy cảm.', '2024-05-06 23:41:03', 2);
INSERT INTO `sanpham` VALUES (5, 'Dầu Dưỡng Tóc Olexrs', , 115000, 50, 'ARGANOIL', 'Điều kiện thường', 'Phục hồi tóc hư tổn', 'Hàn Quốc', 450, 'Tinh Dầu Phục Hồi Tóc Hư Tổn Argan Olexrs + Hair Salon với công thức 100% tinh dầu Argan Oil giúp phục hồi tóc hư tổn nặng, xơ, khô, chẻ ngọn, gãy rụng, hư tổn do nhuộm, duỗi, làm xoăn,… giúp tóc chắc khỏe, bóng mượt, cân bằng độ ẩm, chống tia cực tím.\r\n\r\nCông dụng:\r\n\r\n– Giúp phục hồi tóc hư tổn do nhuộm, duỗi, uốn,…\r\n– Giúp tóc chắc khỏe, bóng mượt, cân bằng độ ẩm, chống tia UV…\r\n– Thành phần chính chiết xuất từ ​​Dầu Argan, Sữa ong chúa, Nước hoa hồng giúp mang lại hiệu quả tuyệt vời trong việc cải thiện các hư tổn thường gặp, đặc biệt là tóc chẻ ngọn, khô gãy\r\n– Hương hoa tự nhiên, giúp bạn duy trì mái tóc thơm ngát, bồng bềnh suốt cả ngày.\r\n\r\nHướng dẫn sử dụng:\r\n– Gội sạch và lau khô tóc hoặc sấy khô 80%.\r\n– Xoa tay với 2-3 giọt tinh dầu (hoặc nhiều hơn, tùy độ dài của tóc) và massage đều vào ngọn tóc, đặc biệt là phần tóc hư tổn.\r\n– Sử dụng kết hợp với dầu gội, dầu xả và kem ủ tóc Olexrs để thấy hiệu quả rõ rệt.', '2024-05-06 23:42:48', 3);

