INSERT INTO `tintuc` VALUES (1, 'Đi tìm 5 loại kem chống nắng vật lý tốt cho làn da bạn gái châu Á', , 'Sử dụng kem chống nắng vật lý vừa bảo vệ cho làn da của bạn, vừa góp phần bảo vệ môi trường sống xung quanh trở nên tốt hơn. Và đó cũng chính là “xu hướng mới” được các bạn gái châu Á chào đón nồng nhiệt.\r\n\r\nVới khí hậu nhiệt đới có nắng gắt như Việt Nam, thật khó để bạn “tẩy chay” kem chống nắng ra khỏi thế giới chăm sóc da của riêng bạn.\r\n\r\nVì dù cho bạn có chăm sóc da kỹ lưỡng và tốt đến cỡ nào, thì bước bảo vệ làn da khỏi ánh nắng mặt trời vẫn luôn được đề cao hết mức. Nếu không thì cả một quá trình dưỡng da của bạn đều “đổ sông đổ biển” trong nay mai. Vì vậy, thiếu gì thì thiếu chứ đừng thiếu kem chống nắng bạn nhé!\r\n\r\nThế nhưng, với thị trường mỹ phẩm “màu mỡ” như hiện nay, thì hẳn là các bạn gái lần đầu làm quen với kem chống nắng, sẽ khá bối rối khi lựa chọn sản phẩm. Liệu giữa kem chống nắng vật lý và hóa học, mình nên sử dụng loại nào là phù hợp ? Và liệu sản phẩm kem chống nắng này có tốt cho làn da châu Á, thậm chí là không gây nguy hiểm cho những rặng san hô ?\r\nĐừng lo! Tất cả mọi điều bạn băn khoăn sẽ được Mai Hân mỹ phẩm\r\n“giải mã” ngay sau đây thôi.\r\n\r\nTùy thuộc vào từng loại da, mà các bạn gái châu Á sẽ lựa chọn cho mình những sản phẩm kem chống nắng phù hợp. Bởi dù là kem chống nắng vật lý hay hóa học, thì chúng đều có những ưu khuyết điểm riêng bù trừ cho nhau.\r\n\r\nTuy nhiên, chúng mình vẫn khuyến khích các bạn gái châu Á sử dụng kem chống nắng vật lý, vì đây là sản phẩm phù hợp với đa số các loại da, dễ sử dụng và tốt cho làn da châu Á, nhất là những bạn có làn da dạy cảm sẽ không gây kích ứng da. Đặc biệt, là thành phần của kem rất thân thiện với môi trường, không gây ngụy hại cho rặng san hô.\r\n\r\nVà để dễ dàng hơn cho bạn trong việc đi tìm các sản phẩm kem chống nắng tốt cho da, Mai Hân mỹ phẩm sẽ “gợi ý” cho bạn 3 loại kem chống nắng vật lý tốt cho làn da châu Á, được nhiều chị em ưa chuộng và tin dùng trong suốt thời gian gần đây nhé.', '2024-05-06 23:28:36');
INSERT INTO `tintuc` VALUES (2, 'Top 8 kem chống nắng được yêu thích nhất dành cho cô nàng da nhạy cảm', , 'Ưu điểm:\n\n Hỗ trợ dưỡng ẩm.\n Không để lại vệt trắng\n Không làm khô da, không gây bức bí.\n Có khả năng kiểm soát dầu hiệu quả.\n Chống nắng phổ rộng, ngăn nám, ngừa lão hóa\nNhược điểm:\n\nGiá thành khá cao\n\nReview sản phẩm:\n\nChứa 2 thành phần chống nắng cực kỳ hiệu quả là: Zinc Oxide và Titanium Dioxide\nChỉ số SPF cao, ngăn chặn cả tia UVA/UVB.\nPhù hợp cho mọi loại da, ít gây nhờn và kích ứng da.\nKhông mùi, không chứa dầu và cồn khoáng.\nSản phẩm vừa có thể chống nắng, vừa tôn được tone da sáng tự nhiên.\n2. Kem dưỡng che khuyết điểm và chống nắng Premium Placenta BB Cream\nSo với các sản phẩm kem chống nắng khác, kem dưỡng che khuyết điểm và chống nắng Premium Placenta BB Cream của thương hiệu White Label rất được lòng các cô nàng da nhạy cảm ở độ tuổi học sinh – sinh viên. Không chỉ nằm ở sự kết hợp hoàn hảo giữa việc vừa che khuyết điểm, vừa chống nắng, mà sản phẩm cón có mức giá “khá hời”.\n3. Sữa dưỡng ẩm chống nắng Paula`s Choice Calm Mineral Moisturizer SPF 30\nPaula’s Choice Skincare hiện là cái tên “sáng giá” nhất trong thế giới chăm sóc da, bởi nơi đây bạn có thể dễ dàng tìm mua cho mình những sản phẩm phù hợp với từng loại da.\n\nLàn da nhạy cảm vốn dĩ đã “khó chiều” ngay từ lúc ban đầu, bạn lại càng không thể thoa hết tất cả những sản phẩm dưỡng da lên mặt cùng một lúc. Vì như thế, sẽ khiến cho làn da bé bỏng dễ kích ứng của bạn cảm thấy quá tải, từ đó da lại càng mẫn cảm hơn.\n\nVà chính vì hiểu được điều đó, Paula’s Choice Skincare đã cho ra đời “siêu phẩm” một công đôi ba việc là sữa dưỡng ẩm chống nắng Paula`s Choice Calm Mineral Moisturizer SPF 30, vừa giúp các nàng dưỡng ẩm, chống nắng chỉ trong 1 bước duy nhất.', '2024-05-07 13:29:42');
INSERT INTO `tintuc` VALUES (3, 'Hướng dẫn sử dụng mỹ phẩm đúng cách', , 'Với phụ nữ việc sở hữu một làn da trắng dáng và mềm mịn là điều cần thiết . Vì vậy, họ không ngần ngại chi một khoản tiền lớn để mua các loại mỹ phẩm chăm sóc da .Nhưng có rất nhiều người đã gặp phải tình trạng tiền mất tật mang khi không sử dụng mỹ phẩm đúng cách.Bài viết dưới đây của mỹ phẩm tắm trắng toàn thân Vy Barbie sẽ chỉ ra các sai lầm cũng như hướng dẫn các chị em cách sử dụng mỹ phẩm như thế nào là đúng cách\n\nMỹ phẩm có thể được xem là một con dao hai lưỡi ,bởi có thể chỉ cần một sai sót nhỏ hoặc sử dụng mỹ phẩm khác nhau cũng có thể khiến bạn gặp hoạ. Bởi mỗi mỹ phẩm được chiết xuất theo một cách riêng và nếu đủ am hiểu mới có thể kết hợp các loại mỹ phẩm với nhau.\n\nNhững sai lầm cơ bản khi chọn mỹ phẩm\n1. Sai lầm khi không chọn mỹ phẩm phù hợp với từng loại da\nCó rất nhiều phụ nữ cho rằng chỉ cần mua các các loại mỹ phẩm đắt tiền từ các thương hiệu nổi tiếng thì có thể có một làn da đẹp và mịn màng.Đây chính là sai lầm khiến làn da của bạn sẽ bị tồn hại , nổi mụn hoặc các tác dụng phụ khác.Bởi mỗi người sẽ có một làn da khác nhau,nếu không chọn những loại mỹ phẩm không phù hợp dù có đắt tiền cũng không thể cải thiện da mà còn ngược lại gây hại cho da.\n\nTheo như nghiên cứu của các chuyên gia , hầu hết phụ nữ Việt sở hữu một làn da hỗn hợp.Đây là một làn da phức tạp khi vùng mũi ,trán rất nhờn còn hai bên má và lại rất khô. Làn da này dễ bị các tác hại của bên ngoài như khó bụi ,ô nhiễm môi trường khiến da tổn hại .Và gây nên mụn , nám làm bạn mất tự tin trước mọi người .\n\nVới phụ nữ việc sở hữu một làn da trắng dáng và mềm mịn là điều cần thiết . Vì vậy, họ không ngần ngại chi một khoản tiền lớn để mua các loại mỹ phẩm chăm sóc da .Nhưng có rất nhiều người đã gặp phải tình trạng tiền mất tật mang khi không sử dụng mỹ phẩm đúng cách.Bài viết dưới đây của mỹ phẩm tắm trắng toàn thân Vy Barbie sẽ chỉ ra các sai lầm cũng như hướng dẫn các chị em cách sử dụng mỹ phẩm như thế nào là đúng cách\n\nSử dụng mỹ phẩm như thế nào là đúng cách ?\n\nSử dụng mỹ phẩm như thế nào là đúng cách ?\n\nMỹ phẩm có thể được xem là một con dao hai lưỡi ,bởi có thể chỉ cần một sai sót nhỏ hoặc sử dụng mỹ phẩm khác nhau cũng có thể khiến bạn gặp hoạ. Bởi mỗi mỹ phẩm được chiết xuất theo một cách riêng và nếu đủ am hiểu mới có thể kết hợp các loại mỹ phẩm với nhau.\n\nNhững sai lầm cơ bản khi chọn mỹ phẩm\n1. Sai lầm khi không chọn mỹ phẩm phù hợp với từng loại da\nCó rất nhiều phụ nữ cho rằng chỉ cần mua các các loại mỹ phẩm đắt tiền từ các thương hiệu nổi tiếng thì có thể có một làn da đẹp và mịn màng.Đây chính là sai lầm khiến làn da của bạn sẽ bị tồn hại , nổi mụn hoặc các tác dụng phụ khác.Bởi mỗi người sẽ có một làn da khác nhau,nếu không chọn những loại mỹ phẩm không phù hợp dù có đắt tiền cũng không thể cải thiện da mà còn ngược lại gây hại cho da.\n\nTheo như nghiên cứu của các chuyên gia , hầu hết phụ nữ Việt sở hữu một làn da hỗn hợp.Đây là một làn da phức tạp khi vùng mũi ,trán rất nhờn còn hai bên má và lại rất khô. Làn da này dễ bị các tác hại của bên ngoài như khó bụi ,ô nhiễm môi trường khiến da tổn hại .Và gây nên mụn , nám làm bạn mất tự tin trước mọi người .\n\nSử dụng mỹ phẩm như thế nào là đúng cách ?\n\nSử dụng mỹ phẩm như thế nào là đúng cách ?\n\n2. Không tìm hiểu về nguồn gốc xuất xứ của các loại mỹ phẩm\nSai lầm thứ hai là sử dụng mỹ phẩm không rõ nguồn gốc xuất xứ. Đây chính là sai lầm mà hầu hết đại đa số các chị em phụ nữ đều mắc phải. Bởi họ không hề tìm hiểu kĩ trước khi sử dụng mà chỉ tin lời của những quảng cáo trên facebook hoặc một người nào đó giới thiệu .Đã có rất nhiều người sau một thời da ngắn , chẳng những không đẹp lên như mong muốn mà còn tá hoả khi khuôn mặt bị bị bỏng rát, sưng phù, nổi mụn chi chít mất rất nhiều tiền bạc và thời gian để vào bệnh viện điều trị\n\nĐa số chị em khi sử dụng mỹ phẩm đều không chú ý đến các bảo quản và sai lầm thứ ba chính là đây.Bởi mỹ phẩm được bảo quản trong thời gian 3 năm kể từ ngày sản xuất và với điều kiện môi trường mát mẻ và chưa mở nắp. Nếu đã mở nắp sản phẩm thì chất bảo quản sẽ bị phân huỷ và ảnh hưởng đến chất lượng của sản phẩm.\n\nTham Khảo Bài Viết: Kinh Nghiệm Cần Biết Khi Mua Mỹ Phẩm\n\n3.Không chú ý thời gian sản xuất và hạn sử dụng\nHạn sử dụng mỹ phẩm chính là sai lầm thứ tư của phụ nữ khi sử dụng mỹ phẩm. Rất nhiều người thường mua sản phẩm như không hề chú ý đến thời gian sản xuất cũng như hạn sử dụng .Nếu mỹ phẩm hết hạn sử dụng mỹ phẩm có thể xảy ra các tác dụng phụ và gây ảnh hưởng cho da', '2024-05-07 13:31:27');

-- ----------------------------
-- Procedure structure for sp_ctdonhang_getbydonhang
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_ctdonhang_getbydonhang`;
delimiter ;;
CREATE PROCEDURE `sp_ctdonhang_getbydonhang`(IN p_id INT)
BEGIN
    SELECT c.*, s.ten AS TenSanPham
		FROM chitietdonhang c 
		INNER JOIN sanpham s ON c.sanpham_id = s.id
		WHERE c.donhang_id = p_id;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for sp_donhang_create
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_donhang_create`;
delimiter ;;
CREATE PROCEDURE `sp_donhang_create`(IN p_ten VARCHAR(255),
    IN p_diachi VARCHAR(255),
    IN p_sodienthoai VARCHAR(255),
    IN p_trangthai INT,
    IN p_nguoidungid INT,
    IN p_listchitiet TEXT)
BEGIN
    DECLARE donhang_id INT;

    INSERT INTO donhang (ten, diachi, sodienthoai, ngaydat, trangthai, nguoidung_id)
    VALUES (p_ten, p_diachi, p_sodienthoai, NOW(), p_trangthai, p_nguoidungid);

    SET donhang_id = LAST_INSERT_ID();

    IF p_listchitiet IS NOT NULL THEN
        INSERT INTO chitietdonhang (soluong, gia, sanpham_id, donhang_id)
        SELECT 
            JSON_UNQUOTE(JSON_EXTRACT(value, '$.SoLuong')),
            JSON_UNQUOTE(JSON_EXTRACT(value, '$.Gia')),
            JSON_UNQUOTE(JSON_EXTRACT(value, '$.SanPham_ID')),
            donhang_id
        FROM JSON_TABLE(p_listchitiet, '$[*]' COLUMNS(value JSON PATH '$')) AS jt;
    END IF;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for sp_donhang_getall_desc
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_donhang_getall_desc`;
delimiter ;;
CREATE PROCEDURE `sp_donhang_getall_desc`()
BEGIN
    SELECT d.*, n.ten AS TenNguoiDung
		FROM donhang d 
		INNER JOIN nguoidung n ON d.nguoidung_id = n.id
		ORDER BY d.ngaydat DESC;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for sp_donhang_getbyid
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_donhang_getbyid`;
delimiter ;;
CREATE PROCEDURE `sp_donhang_getbyid`(IN p_id INT)
BEGIN
    SELECT d.*, n.ten AS TenNguoiDung
		FROM donhang d 
		INNER JOIN nguoidung n ON d.nguoidung_id = n.id
		WHERE d.id = p_id;
END
;;
delimiter ;

