-- ----------------------------
-- Procedure structure for sp_donhang_update
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_donhang_update`;
delimiter ;;
CREATE PROCEDURE `sp_donhang_update`(IN p_id INT,
    IN p_trangthai INT)
BEGIN
    UPDATE donhang 
    SET 
				trangthai = IFNULL(p_trangthai, trangthai)
    WHERE id = p_id;
END
;;
delimiter ;

