		IN p_xuatxu VARCHAR(255),
		IN p_dungtich INT,
		IN p_mota TEXT,
		IN p_loaiid INT)
BEGIN
    INSERT INTO sanpham (ten, anh, gia, soluong, thuonghieu, dieukienbaoquan, congdung, xuatxu, dungtich, mota, ngaytao, loai_id)
    VALUES (p_ten, p_anh, p_gia, p_soluong, p_thuonghieu, p_dieukienbaoquan, p_congdung, p_xuatxu, p_dungtich, p_mota, NOW(), p_loaiid);
END
