delimiter ;;
CREATE PROCEDURE `sp_sanpham_random`(IN p_sl INT)
BEGIN
    SELECT s.*, l.ten AS TenLoai
		FROM sanpham s 
		INNER JOIN loaisanpham l ON s.loai_id = l.id
		ORDER BY RAND()
		LIMIT p_sl;
END
;;
