-- ----------------------------
-- Procedure structure for sp_sanpham_search
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_sanpham_search`;
delimiter ;;
CREATE PROCEDURE `sp_sanpham_search`(IN p_ten VARCHAR(255))
BEGIN
    SELECT s.*, l.ten AS TenLoai
		FROM sanpham s 
		INNER JOIN loaisanpham l ON s.loai_id = l.id
		WHERE s.ten LIKE CONCAT('%', p_ten, '%') OR l.ten LIKE CONCAT('%', p_ten, '%')
		ORDER BY s.ngaytao DESC;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for sp_sanpham_update
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_sanpham_update`;
delimiter ;;
CREATE PROCEDURE `sp_sanpham_update`(IN p_id INT,
    IN p_ten VARCHAR(255),
		IN p_anh LONGBLOB,
		IN p_gia INT,
		IN p_soluong INT,
		IN p_thuonghieu TEXT,
		IN p_dieukienbaoquan TEXT,
		IN p_congdung TEXT,
		IN p_xuatxu VARCHAR(255),
		IN p_dungtich INT,
		IN p_mota TEXT,
		IN p_loaiid INT)
BEGIN
    UPDATE sanpham 
    SET 
        ten = IFNULL(p_ten, ten),
        anh = IFNULL(p_anh, anh),
        gia = IFNULL(p_gia, gia),
        soluong = IFNULL(p_soluong, soluong),
        thuonghieu = IFNULL(p_thuonghieu, thuonghieu),
        dieukienbaoquan = IFNULL(p_dieukienbaoquan, dieukienbaoquan),
				congdung = IFNULL(p_congdung, congdung),
				xuatxu = IFNULL(p_xuatxu, xuatxu),
				dungtich = IFNULL(p_dungtich, dungtich),
				mota = IFNULL(p_mota, mota),
				loai_id = IFNULL(p_loaiid, loai_id)
    WHERE id = p_id;
END
;;
delimiter ;

